import React, {useEffect} from "react";
import { useDispatch, useSelector } from "react-redux";

import FilmListShow from "pages/FilmListPage/FilmListShow";

import routeMain from "./routes";

import { loadDetails } from "store/DetailPage/actions";
import { selectDetails } from "store/DetailPage/selectors";

const SearchPage = () => {
    const dispatch = useDispatch();
    const arrayListFilms = useSelector(selectDetails);

    useEffect(() => {
        dispatch(loadDetails());
    }, [dispatch])


    return ( 
        <div className='container'>
            {arrayListFilms.length > 0 ? (
                   arrayListFilms.map(detail => (
                        <FilmListShow
                        list={detail}
                        key={detail.id}
                        />
                   ))
               ) : <div>пусто</div>}
            
        </div>
        
        
    )
}



export {routeMain};

export default SearchPage;

